sys_variable_value.value:
(function execute(inputs, outputs) {
var response = JSON.parse(inputs.response)
var schema = response.schema

outputs.schema_context = schema.contextURL
outputs.schema_type = schema.type
outputs.field1_context = schema.fields[1].context.context[0]
outputs.field1_type = schema.fields[1].context.type
outputs.field2_context = schema.fields[2].context.context[0]
outputs.field2_type = schema.fields[2].context.type
outputs.field3_context = schema.fields[3].context.context[0]
outputs.field3_type = schema.fields[3].context.type


})(inputs, outputs);

